import React from "react";
import Card from "../components/card/Card";

const CardList = ({ monsters }) => {
    const cardlist = monsters.map((monster, index) => {
        return (
        <Card key={index}
              id={monster[index].id}
              name={monster[index].name}
              email={monster[index].email}
              />
        );
    });

    return(
        <div>
            {cardlist}
        </div>
    );
}
export default CardList;
